import {Image, ScrollView, StyleSheet, Text, View} from 'react-native';
import React from 'react';

export default function ContactsList() {
  const contacts = [
    {
      id: 1,
      name: 'Bhagat Singh',
      role: 'A revolutionary freedom fighter and activist.',
      contact: 45358,
      imageUrl:
        'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRm9lThH7ABqGpQrSeQ-Y-LxLOaHzJ4aOY_JQ&s',
    },
    {
      id: 2,
      name: 'Bal Gangadhar Tilak',
      role: 'The slogan – “Swaraj is my birthright”',
      contact: 453435358,
      imageUrl:'https://wp.edsys.in/wp-content/uploads/2019/11/bal-gangadhar-tilak-1050x1553-1-203x300.jpg'

    },
    {
      id: 3,
      name: 'Sarojini Naidu',
      role: 'An Independence activist, poet, and politician.',
      contact: 688958,
      imageUrl:
        'data:image/jpeg;base64,',
    },
    {
      id: 4,
      name: 'Subhash Chandra Bose',
      role: 'A look at powerful quotes by freedom fighters.',
      contact: 886889,
      imageUrl:
        'data:image/jpeg;base64,',
    },
    {
      id: 5,
      name: 'Jawaharlal Nehru',
      role: 'Popular as a freedom fighter of india.',
      contact: 44533698,
      imageUrl:
        'data:image/jpeg;base64,',
    },
  ];
  return (
    <View>
      <Text style={styles.titleText}>Contacts List</Text>
      <ScrollView style={styles.container} scrollEnabled={false}>
        {contacts.map(({id, name, role, imageUrl}) => (
          <View key={id} style={styles.userCard}>
            <Image
              source={{
                uri: imageUrl,
              }}
              style={styles.userImage}
            />
            <View>
              <Text style={styles.userName}>{name}</Text>
              <Text style={styles.userRole}>{role}</Text>
            </View>
          </View>
        ))}
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({
  titleText: {
    color: '#000000',
    fontSize: 24,
    fontWeight: 'bold',
    paddingHorizontal: 8,
  },
  container: {
    paddingHorizontal: 16,
    marginBottom: 4,
  },
  userCard: {
    flex: 1,
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 4,
    backgroundColor: '#67E6DC',
    padding: 8,
    borderRadius: 14,
  },
  userImage: {
    width: 60,
    height: 60,
    borderRadius: 60 / 2,
    marginRight: 13,
  },
  userName: {
    color: '#000',
    fontSize: 16,
    fontWeight: '600',
  },
  userRole: {
    fontSize: 14,
    textAlign:'justify',
   fontWeight:'500'
  },
});
